INSERT INTO survey_player VALUES (4, 4, 0.00, 4, 1, 1, 'f', 'f', NULL, '', 21, 'mnnlich', '1. Habe immer nur das in die Fertigung gegeben, dass in den nchsten 10 Tagen fertig werden musste, da ich ansonsten logischerweise Lagerkosten htte. Da dei durchschnittliche Zeit im System nie ber 10 Tage war konnte ich dies das ganze Experiment lange machen. 
