INSERT INTO survey_player VALUES (9, 9, 0.00, 9, 1, 1, 'f', 'f', NULL, '', 23, 'weiblich', 'Ich bin vom zugesagten Liefertermin ausgegangen und die Differenz vom Auftragseingang genommen. Ich hab sie spter gendert und alle Auftrge freigegeben, weil sich die anderen sonst versptet haben. 
INSERT INTO survey_player VALUES (18, 18, 0.00, 18, 1, 1, 'f', 'f', NULL, '', 24, 'weiblich', 'je knapper das Datum, desto mehr Prioritt d.h. diese Auftrge wurden bevorzugt. 
INSERT INTO survey_player VALUES (20, 20, 0.00, 20, 1, 1, 'f', 'f', NULL, '', 24, 'mnnlich', '1.1 -- ich habe nun die Auftrge die dringend waren freigegeben (10 tage) damit ich keine kosten habe
INSERT INTO survey_player VALUES (13, 13, 0.00, 13, 1, 1, 'f', 'f', NULL, '', 23, 'weiblich', 'da jede Runde aus 10 Tage besteht, hab ich auf das morgige Datum geschaut und dann geschaut welcher Vorgang durchgefhrt werden soll damit ich keine Wartezeit im Lager habe aber auch keine davor. 
INSERT INTO survey_player VALUES (8, 8, 0.00, 8, 1, 1, 'f', 'f', NULL, '', 21, 'mnnlich', '1.1 immer  die ersten 2 freigeben (Liefertermin in 10 Tagen), da hier durch Ausprobieren in der bungsphase keine Kosten entstanden sind
INSERT INTO survey_player VALUES (22, 22, 0.00, 22, 1, 1, 'f', 'f', NULL, '', 20, 'mnnlich', 'Das Ziel des Experiments ist es die Kosten mglichst gering zu halten daher hab ich versucht nur solche Auftrge freizugeben welche zeitbezglich anfallen um kein Lager zu halten.
INSERT INTO survey_player VALUES (1, 1, 0.00, 1, 1, 1, 'f', 'f', NULL, '', 23, 'weiblich', '1. Ich habe mir die durchschnittliche Zeit im System des vergangenen Jahres angesehen und wann der Auftrag hereingekommen ist. Dann habe ich geschaut wann der Liefertermin ist und habe so berechnet wie lang etwa die Wartezeit ist. 
INSERT INTO survey_player VALUES (2, 2, 0.00, 2, 1, 1, 'f', 'f', NULL, '', 19, 'weiblich', '1. Ich habe in den Proberunden probiert zu analysieren, wie viele Kosten bei welcher Freigabeentscheidung verursacht werden. Meine Logik bestand somit darin, zu verstehen welche die Freigabeentscheidung mit den minimalsten Kosten ist und bei dieser zu bleiben.Ich habe meine Logik im Laufe der Durchfhrungsphase angepasst.
INSERT INTO survey_player VALUES (10, 10, 0.00, 10, 1, 1, 'f', 'f', NULL, '', 19, 'mnnlich', '1. 1. Ich rumte den dringensten Auftrgen die grte Prioritt ein: Auftrge, welche in 10 Tagen fllig waren, wurden daher von mir bevorzugt behandelt. 
INSERT INTO survey_player VALUES (5, 5, 0.00, 5, 1, 1, 'f', 'f', NULL, '', 28, 'weiblich', '1.1. Alle 10 Tage die ersten 2 Auftrge
INSERT INTO survey_player VALUES (17, 17, 0.00, 17, 1, 1, 'f', 'f', NULL, '', 24, 'mnnlich', '1. Anfangs dachte ich 3 Auftrge zu nehmen um keine Versptung einzugehen und dafr Lagerkosten in Kauf zu nehmen.
INSERT INTO survey_player VALUES (24, 24, 0.00, 24, 1, 1, 'f', 'f', NULL, '', 24, 'mnnlich', 'In der Proberunde sind hufig Kosten fr Lager und Versptungen entstanden. Nachdem der erste Auftrag der Hauptrunde ohne Kosten durchgefhrt wurde, habe ich diese Strategie beibehalten. Es sind immer 2 Auftrge hinzugekommen, welche in 10 Tagen Ausgeliefert werden mussten. Diese Routine hat sich whrend des gesamten Prozesses aufrechterhalten. Es sind jeweils 2 Auftrge abgearbeitet worden, und 2 neue hinzugekommen. Aufgrund dieser Tatsache, und der Tatsache dass beim Produktionsprozess nach jeder Runde die Rckmeldung kam, dass keine Kosten entstanden sind, habe ich diese Strategie beibehalten.
INSERT INTO survey_player VALUES (16, 16, 0.00, 16, 1, 1, 'f', 'f', NULL, '', 22, 'weiblich', 'Zu Beginn hin habe ich versucht Versptungen zu vermeiden. Ich denke jedoch, dass ich das Experiment nicht ganz verstanden habe, da ich laut meiner Logik am Anfang fast keine Versptungen hatte. Gegen Ende hin habe ich kein Schema mehr befolgt, da ich ohne hin schon zu hohe Kosten hatte. Ich persnlich finde es war etwas schwach erklrt, da ich mir eigentlich nicht dachte, dass es Schwierigkeiten geben knnte, die es dann sehr wohl gegeben hat. ', 'BHS (berufsbildende hohere Schule)', 'Fakultt fr Betriebswirtschaft', 'Ja', 8, 6, 5, 3, 4, 4, 4, 4, 4, 6, 5, 4, 6, 6, 6, NULL, 'Es waren nicht wirklich unsicherheiten, es lag daran dass ich das Konzept nicht verstanden habe. ', 5, 4, 4, 5, 5, 6, 2, 't', 't', 't', 't', 't', 4, 1, 1);
INSERT INTO survey_player VALUES (14, 14, 0.00, 14, 1, 1, 'f', 'f', NULL, '', 22, 'mnnlich', 'Ich habe meine Logik geandert, denn ich habe gesehen, dass die Kosten niedriger wurden wenn ich frhere Liefertermine gewhlt habe. Ich habe die Aufgabe nicht wirklich verstanden.
INSERT INTO survey_player VALUES (7, 7, 0.00, 7, 1, 1, 'f', 'f', NULL, '', 21, 'weiblich', '1.Ich habe mir die Experimentanleitung zu Beginn sehr gut durchgelesen. Dadurch habe ich eigentlich schon sehr gut verstanden, was zu tun ist. Zudem konnte ich bei der Probephase noch einmal einige verschiedene Mglichkeiten ausprobieren und somit habe ich schnell erkannt, dass eigentlich jede Runde 2 Auftrge eingesendet werden mssen, um keine Zusatzkosten bezahlen zu mssen. In der Durchfhrungsphase musste ich also nicht mehr umbeding so viel nachdenken, ich habe immer zwei Auftrge zur Produktion freigegeben und habe einfach nur darauf geachtet, dass ich alles pnkltich liefern kann. Zudem habe ich auch darauf Acht gegeben, wie die Mengen der zu produzierenden Auftrge war, aber da die Menge immer eins war, musste ich meine Strategie nicht verndern. 
INSERT INTO survey_player VALUES (15, 15, 0.00, 15, 1, 1, 'f', 'f', NULL, '', 26, 'mnnlich', '1. kein Risiko
INSERT INTO survey_player VALUES (19, 19, 0.00, 19, 1, 1, 'f', 'f', NULL, '', 24, 'weiblich', 'Ich habe mir berlegt, was die durchschnittliche Zeit im System aussagt - ich habe absolut nicht verstanden, warum immer ~ 90 Tage zwischen Auftragseingang und zugesagtem Liefertermin lagen. Es htte mehr Sinn gemacht, wenn die durchschnittliche Zeit auszurechnen gewesen wre. 
INSERT INTO survey_subsession VALUES (1, 1, 1);
